import React from "react";
import "./App.scss";
import NavigationBar from "./components/NavigationBar/NavigationBar";
import LandingSection from "./sections/Landing/LandingSection";
import AboutSection from "./sections/About/AboutSection";

const App = () => {
  return (
    <div className="App">
      <NavigationBar />
      <LandingSection />
      <AboutSection />
    </div>
  );
};

export default App;

